ost\",\"definition\":\"How many socket instruments could not be loaded\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.performance_schema_socket_instances_lost\":{\"name\":\"mysql.performance_schema_socket_instances_lost\",\"definition\":\"How many socket instrument instances could not be created\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.performance_schema_stage_classes_lost\":{\"name\":\"mysql.performance_schema_stage_classes_lost\",\"definition\":\"How many stage instruments could not be loaded\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.performance_schema_statement_classes_lost\":{\"name\":\"mysql.performance_schema_statement_classes_lost\",\"definition\":\"How many statement instruments could not be loaded\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.performance_schema_table_handles_lost\":{\"name\":\"mysql.performance_schema_table_handles_lost\",\"definition\":\"How many table instrument instances could not be opened\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.performance_schema_table_instances_lost\":{\"name\":\"mysql.performance_schema_table_instances_lost\",\"definition\":\"How many table instrument instances could not be created\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.performance_schema_thread_classes_lost\":{\"name\":\"mysql.performance_schema_thread_classes_lost\",\"definition\":\"How many thread instruments could not be loaded\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.performance_schema_thread_instances_lost\":{\"name\":\"mysql.performance_schema_thread_instances_lost\",\"definition\":\"The number of thread instances that could not be instrumented in the threads table\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.performance_schema_users_lost\":{\"name\":\"mysql.performance_schema_users_lost\",\"definition\":\"The number of times a row could not be added to the users table because it was full\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.prepared_stmt_count\":{\"name\":\"mysql.prepared_stmt_count\",\"definition\":\"The current number of prepared statements.\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.qcache_free_blocks\":{\"name\":\"mysql.qcache_free_blocks\",\"definition\":\"Query Cache 中目前还有多少剩余的blocks。如果该值显示较大，则说明Query Cache 中的内存碎片较多了，可能需要寻找合适的机会进行整理。\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.qcache_free_memory\":{\"name\":\"mysql.qcache_free_memory\",\"definition\":\"Query Cache 中目前剩余的内存大小。通过这个参数我们可以较为准确的观察出当前系统中的Query Cache 内存大小是否足够，是需要增加还是过多了；\",\"type\":\"data\",\"unit\":\"bytes\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.qcache_hits\":{\"name\":\"mysql.qcache_hits\",\"definition\":\"多少次命中。通过这个参数我们可以查看到Query Cache 的基本效果；\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.qcache_inserts\":{\"name\":\"mysql.qcache_inserts\",\"definition\":\"多少次未命中然后插入。通过“Qcache_hits”和“Qcache_inserts”两个参数我们就可以算出Query Cache 的命中率了：\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.qcache_lowmem_prunes\":{\"name\":\"mysql.qcache_lowmem_prunes\",\"definition\":\"多少条Query 因为内存不足而被清除出Query Cache。通过“Qcache_lowmem_prunes”和“Qcache_free_memory”相互结合，能够更清楚的了解到我们系统中Query Cache 的内存大小是否真的足够，是否非常频繁的出现因为内存不足而有Query 被换出\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.qcache_not_cached\":{\"name\":\"mysql.qcache_not_cached\",\"definition\":\"因为query_cache_type 的设置或者不能被cache 的Query 的数量；\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.qcache_queries_in_cache\":{\"name\":\"mysql.qcache_queries_in_cache\",\"definition\":\"当前Query Cache 中cache 的Query 数量；\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.qcache_total_blocks\":{\"name\":\"mysql.qcache_total_blocks\",\"definition\":\"当前Query Cache 中的block 数量\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.select_full_join\":{\"name\":\"mysql.select_full_join\",\"definition\":\"Number of full joins needed to answer queries. If too high, improve your indexing or database schema\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.select_full_range_join\":{\"name\":\"mysql.select_full_range_join\",\"definition\":\"The number of joins that used a range search on a reference table\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.select_range\":{\"name\":\"mysql.select_range\",\"definition\":\"The number of joins that used ranges on the first table. This is normally not a critical issue even if the value is quite large\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.select_range_check\":{\"name\":\"mysql.select_range_check\",\"definition\":\"The number of joins without keys that check for key usage after each row. If this is not 0, you should carefully check the indexes of your tables\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.select_scan\":{\"name\":\"mysql.select_scan\",\"definition\":\"The number of joins that did a full scan of the first table\",\"type\":\"number\",\"unit\":\"short\",\"recommend\":\"\",\"alert\":\"\",\"isKpi\":false},\"mysql.slave_open_temp_tables\":{\"name\":\"mysql.slave_open_temp_tables\",\"definition\":\"The number of temp