INSERT INTO `cwiz_static`(`id`, `org_id`, `type`, `name`, `json_data`, `created`, `updated`) VALUES (84, 0, 'email', 'new_user_invite_body', '<table class=\"row\">\n  <tr>\n    <td class=\"wrapper last\">\n\n     <table class=\"twelve columns\">\n        <tr>\n          <td>\n            <h3>您已经被邀请加入 ${org_name !\'\'}</h3>\n         </td>\n         <td class=\"expander\"></td>\n        </tr>\n     </table>\n\n    </td>\n </tr>\n</table>\n\n<table class=\"row\">\n  <tr>\n    <td class=\"wrapper last\">\n     <table class=\"twelve columns\">\n        <tr>\n          <td class=\"center\">\n           <p>您已经被邀请加入 <span class=\"emphasis\">${org_name !\'\'}</span>  请点击以下链接,接受并加入:</p>\n         </td>\n       </tr>\n       <tr>\n          <td class=\"center\">\n                     <table class=\"better-button\" align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n                       <tr>\n                            <td align=\"center\" class=\"better-button\" bgcolor=\"#ff8f2b\"><a href=\"${invite_url !\'\'}\" target=\"_blank\">接受邀请</a></td>\n                          </tr>\n                     </table>\n          </td>\n       </tr>\n       <tr>\n          <td class=\"center\">\n           <p>您可以复制粘贴下面链接到地址栏中直接访问: <a href=\"${invite_url !\'\'}\">${invite_url !\'\'}</a></p>\n          </td>\n         <td class=\"expander\"></td>\n        </tr>\n     </table>\n    </td>\n </tr>\n</table>', '2018-06-27 22:35:35', '2018-06-27 22:35:40');
INSERT INTO `cwiz_static`(`id`, `org_id`, `type`, `name`, `json_data`, `created`, `updated`) VALUES (85, 0, 'email', 'signup_started_body', '<table class=\"row\">\n <tr>\n    <td class=\"wrapper last\">\n\n     <table class=\"twelve columns\">\n        <tr>\n          <td>\n            <h3 class=\"center\">请完成下面操作</h3>\n         </td>\n         <td class=\"expander\"></td>\n        </tr>\n     </table>\n\n    </td>\n </tr>\n</table>\n\n<table class=\"row\">\n  <tr>\n    <td class=\"wrapper last\">\n     <table class=\"twelve columns\">\n        <tr>\n          <td class=\"center\">\n            复制下面的邮箱验证码:<br>\n            <span class=\"verification-code\">${validate_code !\'\'}</span><br>\n            到需要填写的表单中 \n         </td>\n         <td class=\"expander\"></td>\n        </tr>\n       <tr>\n          <td class=\"center\">\n           <table class=\"better-button\" align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n             <tr>\n                <td align=\"center\" class=\"better-button\" bgcolor=\"#ff8f2b\"><a href=\"${signup_with_code_url !\'\'}\" target=\"_blank\"></a></td>\n              </tr>\n           </table>\n          </td>\n       </tr>\n     </table>\n    </td>\n </tr>\n</table>', '2018-06-26 15:58:26', '2018-06-26 15:58:35');
INSERT INTO `cwiz_static`(`id`, `org_id`, `type`, `name`, `json_data`, `created`, `updated`) VALUES (86, 0, 'email', 'invite_to_org_body', '<table class=\"row\">\n  <tr>\n    <td class=\"wrapper last\">\n\n     <table class=\"twelve columns\">\n        <tr>\n          <td>\n            <h3>您已经被邀请加入到 ${org_name !\'\'}</h3>\n          </td>\n         <td class=\"expander\"></td>\n        </tr>\n     </table>\n\n    </td>\n </tr>\n</table>\n\n<table class=\"row\">\n  <tr>\n    <td class=\"wrapper last\">\n     <table class=\"twelve columns\">\n        <tr>\n          <td class=\"center\">\n           <p><span class=\"emphasis\">${invite_by !\'\'}</span> 将您邀请到 <span class=\"emphasis\">${org_name !\'\'}</span> 中\n           <p>一旦登录, ${org_name !\'\'} 将会出现在侧边的菜单栏中, 能够在下拉框中切换公司组织</p>\n          </td>\n         <td class=\"expander\"></td>\n        </tr>\n       <tr>\n          <td class=\"center\">\n           <table class=\"better-button\" align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n             <tr>\n                <td align=\"center\" class=\"better-button\" bgcolor=\"#ff8f2b\"><a href=\"${signin_url !\'\'}\" target=\"_blank\">马上登录</a></td>\n              </tr>\n           </table>\n          </td>\n       </tr>\n     </table>\n    </td>\n </tr>\n</table>', '2018-06-26 16:17:15', '2018-06-26 16:17:23');
INSERT INTO `cwiz_static`(`id`, `org_id`, `type`, `name`, `json_data`, `created`, `updated`) VALUES (87, 0, 'email', 'welcome_on_signup_body', '<table class=\"row\">\n  <tr>\n    <td class=\"wrapper last\">\n\n     <table class=\"twelve columns\">\n        <tr>\n          <td>\n            <h3>您好 ${name !\'\'}</h3>\n         </td>\n         <td class=\"expander\"></td>\n        </tr>\n     </table>\n\n    </td>\n </tr>\n</table>\n\n<table class=\"row\">\n  <tr>\n    <td class=\"wrapper last\">\n     <table class=\"twelve columns\">\n        <tr>\n          <td class=\"center\">\n           <p>\n              如果您是第一次Cloudwiz大数据平台可以阅读 <a href=\"https://download.cloudwiz.cn/public/pdf/cloudwiz_quick_start.pdf\">快速入门</a>\n           </p>\n          </td>\n         <td class=\"expander\"></td>\n        </tr>\n     </table>\n    </td>\n </tr>\n</table>', '2018-06-26 16:20:13', '2018-06-26 16:20:25');
INSERT INTO `cwiz_static`(`id`, `org_id`, `type`, `name`, `json_data`, `created`, `updated`) VALUES (88, 0, 'email', 'pass_reset_body', '<table class=\"row\">\n <tr>\n    <td class=\"wrapper last\">\n\n     <table class=\"twelve columns\">\n        <tr>\n          <td>\n            <h3>您好 ${name !\'\'}, 您的验证码是${pass_code !\'\'}</h3>\n         </td>\n         <td class=\"expander\"></td>\n        </tr>\n     </table>\n\n    </td>\n </tr>\n</table>\n\n<table class=\"row\">\n  <tr>\n    <td class=\"wrapper last\">\n     <table class=\"twelve columns\">\n        <tr>\n          <td class=\"center\">\n           <p>\n              请点击下面链接并在 <strong>30分钟</strong>之内重置您的密码\n            </p>\n            <p>\n             <a href=\"${resetpass_url !\'\'}\">${resetpass_url !\'\'}</a>\n           </p>\n            <p>没有反应? 尝试复制到地址栏中直接访问.</p>\n         </td>\n         <td class=\"expander\"></td>\n        </tr>\n     </table>\n    </td>\n </tr>\n</table>', '2018-06-15 15:39:01', '2018-06-15 15:39:05');
