INSERT INTO `cwiz_static`(`id`, `org_id`, `type`, `name`, `json_data`, `created`, `updated`) VALUES (158, 0, 'config', 'support_services_infomap', '{\"apache\":{\"alias\":\"Apache\",\"conf\":\"apache\",\"dashboard\":\"apache\",\"description\":\"Apache，服务器软件。它可以运行在几乎所有广泛使用的计算机平台上，由于其跨平台和安全性被广泛使用，是最流行的Web服务器端软件之一。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/apache\",\"icon\":\"iconfont fa-Apacheyumao\"},\"docker\":{\"alias\":\"Docker\",\"conf\":\"dockerd\",\"dashboard\":\"docker\",\"description\":\"Docker 是一个开源的应用容器引擎,可以让开发者打包他们的应用以及依赖包到一个轻量级、可移植的容器中,然后发布到任何流行的Linux机器上,也可以实现虚拟化。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/docker_daemon\",\"icon\":\"iconfont fa-docker\"},\"elasticsearch\":{\"alias\":\"ElasticSearch\",\"conf\":\"elasticsearchstat\",\"dashboard\":\"elasticsearch\",\"description\":\"Elasticsearch 是一个分布式的 RESTful 风格的搜索和数据分析引擎，能够解决不断涌现出的各种用例。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/elasticsearch\",\"icon\":\"iconfont fa-ElasticElasticSearch\"},\"hadoop.datanode\":{\"alias\":\"Hadoop DataNode\",\"conf\":\"hadoop_data_node\",\"dashboard\":\"hadoop\",\"description\":\"Hadoop是一个能够对大量数据进行分布式处理的软件框架。 Hadoop 以一种可靠、高效、可伸缩的方式进行数据处理。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/hadoop_datanode\",\"icon\":\"iconfont fa-hadoop29\"},\"hadoop.namenode\":{\"alias\":\"Hadoop NameNode\",\"conf\":\"hadoop_name_node\",\"dashboard\":\"hadoop\",\"description\":\"Hadoop是一个能够对大量数据进行分布式处理的软件框架。 Hadoop 以一种可靠、高效、可伸缩的方式进行数据处理。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/hadoop_namenode\",\"icon\":\"iconfont fa-icon\"},\"haproxy\":{\"alias\":\"HaProxy\",\"conf\":\"haproxy_dev\",\"dashboard\":\"haproxy_dev\",\"description\":\"HAProxy是一个使用C语言编写的自由及开放源代码软件[1]，其提供高可用性、负载均衡，以及基于TCP和HTTP的应用程序代理。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/haproxy\",\"icon\":\"iconfont fa-haproxy\"},\"hbase.master\":{\"alias\":\"Hbase Master\",\"conf\":\"hbase_master\",\"dashboard\":\"hbase\",\"description\":\"HBase – Hadoop Database，是一个高可靠性、高性能、面向列、可伸缩的分布式存储系统，利用HBase技术可在廉价PC Server上搭建起大规模结构化存储集群。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/hbase_master\",\"icon\":\"iconfont fa-hbase\"},\"hbase.regionserver\":{\"alias\":\"Hbase RegionServer\",\"conf\":\"hbase_regionserver\",\"dashboard\":\"hbase\",\"description\":\"HBase – Hadoop Database，是一个高可靠性、高性能、面向列、可伸缩的分布式存储系统，利用HBase技术可在廉价PC Server上搭建起大规模结构化存储集群。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/hbase_regionserver\",\"icon\":\"iconfont fa-hbase\"},\"host.topn\":{\"alias\":\"Host Topn\",\"conf\":\"\",\"dashboard\":\"\",\"description\":\"Host Topn 是定时收集机器上面运行的进程 的 CPU、内存 、IO 等信息的集成服务\",\"doc_url\":\"\",\"icon\":\"iconfont fa-default\"},\"http.check\":{\"alias\":\"Http Check\",\"conf\":\"\",\"dashboard\":\"\",\"description\":\"Http Check 是监控本地或远程HTTP端点的上/下状态，检测错误响应代码（例如404），识别即将到期的SSL证书，搜索特定文本的响应等等的集成服务。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/http_check\",\"icon\":\"iconfont fa-default\"},\"iis\":{\"alias\":\"IIS\",\"conf\":\"win32_iisstats\",\"dashboard\":\"iis\",\"description\":\"iis是Internet Information Services的缩写, 意为互联网信息服务, 是由微软公司提供的基于运行Microsoft Windows的互联网基本服务。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/iis\",\"icon\":\"iconfont fa-iis\"},\"kafka\":{\"alias\":\"Kafka\",\"conf\":\"kafka\",\"dashboard\":\"kafka\",\"description\":\"Kafka是一种高吞吐量的分布式发布订阅消息系统，它可以处理消费者规模的网站中的所有动作流数据。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/kafka\",\"icon\":\"iconfont fa-kafka\"},\"map.reduce\":{\"alias\":\"Map Reduce\",\"conf\":\"\",\"dashboard\":\"\",\"description\":\"Map Reduce 是一个 监控 Map Reduce 服务状态以及有关的故障转移及事件的集成服务\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/map_reduce\",\"icon\":\"iconfont fa-default\"},\"mongo\":{\"alias\":\"MongoDB\",\"conf\":\"mongo3\",\"dashboard\":\"mongodb\",\"description\":\"MongoDB是一个基于分布式文件存储的数据库，由C++语言编写，旨在为WEB应用提供可扩展的高性能数据存储解决方案。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/mongo_db\",\"icon\":\"iconfont fa-mongo-db1\"},\"mysql\":{\"alias\":\"MySQL\",\"conf\":\"mysql\",\"dashboard\":\"mysql\",\"description\":\"MySQL是一个关系型数据库管理系统，其特点为体积小、速度快、总体拥有成本低，且开放源码。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/my_sql\",\"icon\":\"iconfont fa-mysql\"},\"nginx\":{\"alias\":\"Nginx\",\"conf\":\"nginx\",\"dashboard\":\"nginx\",\"description\":\"Nginx是一款轻量级的Web 服务器/反向代理服务器及电子邮件（IMAP/POP3）代理服务器，并在一个BSD-like 协议下发行。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/nginx\",\"icon\":\"iconfont fa-image-icon_nginx\"},\"opentsdb\":{\"alias\":\"OpenTSDB\",\"conf\":\"opentsdb\",\"dashboard\":\"opentsdb\",\"description\":\"开源监控系统OpenTSDB，用hbase存储所有的时序（无须 采样）来构建一个分布式、可伸缩的时间序列数据库。\",\"doc_url\":\"\",\"icon\":\"iconfont fa-opentsdb\"},\"oracle\":{\"alias\":\"Oracle\",\"conf\":\"oracle\",\"dashboard\":\"oracle\",\"description\":\"ORACLE数据库系统是美国ORACLE公司（甲骨文）提供的以分布式数据库为核心的一组软件产品，是目前最流行的客户/服务器(CLIENT/SERVER)或B/S体系结构的数据库之一。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/oracle\",\"icon\":\"iconfont fa-oracle\"},\"play_framework\":{\"alias\":\"Play Framework\",\"conf\":\"play_framework\",\"dashboard\":\"play_framework\",\"description\":\"play framework是一个full-stack（全栈的）Java Web的应用框架，包括一个简单的无状态MVC模型，具有Hibernate的对象持续，一个基于Groovy的模板引擎，以及建立一个现代Web应用所需的所有东西。\",\"doc_url\":\"\",\"icon\":\"iconfont fa-playframework\"},\"postgresql\":{\"alias\":\"PostgreSQL\",\"conf\":\"postgresql\",\"dashboard\":\"postgresql\",\"description\":\"PostgreSQL 是一个自由的对象-关系数据库服务器(数据库管理系统)，它在灵活的 BSD-风格许可证下发行。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/postgre_sql\",\"icon\":\"iconfont fa-postgresql\"},\"rabbitmq\":{\"alias\":\"RabbitMQ\",\"conf\":\"rabbit_mq\",\"dashboard\":\"rabbitmq\",\"description\":\"RabbitMQ是流行的开源消息队列系统，用erlang语言开发。RabbitMQ是AMQP（高级消息队列协议）的标准实现。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/rabbit_mq\",\"icon\":\"iconfont fa-rabbitmq\"},\"redis\":{\"alias\":\"Redis\",\"conf\":\"redisdb\",\"dashboard\":\"redis\",\"description\":\"redis是一个开源的、使用C语言编写的、支持网络交互的、可基于内存也可持久化的Key-Value数据库。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/redis\",\"icon\":\"iconfont fa-redis\"},\"spark\":{\"alias\":\"Spark\",\"conf\":\"spark\",\"dashboard\":\"spark\",\"description\":\"Apache Spark 是专为大规模数据处理而设计的快速通用的计算引擎。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/spark\",\"icon\":\"iconfont fa-spark1\"},\"sqlserver\":{\"alias\":\"SqlServer\",\"conf\":\"win32_sqlserver\",\"dashboard\":\"sqlserver\",\"description\":\"Microsoft SQL Server 是一个全面的数据库平台，使用集成的商业智能 (BI)工具提供了企业级的数据管理。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/sql_server\",\"icon\":\"iconfont fa-sqlserver\"},\"storm\":{\"alias\":\"Storm\",\"conf\":\"storm\",\"dashboard\":\"storm\",\"description\":\"Storm为分布式实时计算提供了一组通用原语，可被用于“流处理”之中，实时处理消息并更新数据库。这是管理队列及工作者集群的另一种方式。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/storm\",\"icon\":\"iconfont fa-ApacheStorm\"},\"system\":{\"alias\":\"System\",\"conf\":\"\",\"dashboard\":\"\",\"description\":\"System 是一个跟踪系统资源使用情况——CPU、内存、磁盘、文件系统等的集成服务。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/system\",\"icon\":\"iconfont fa-default\"},\"tomcat\":{\"alias\":\"Tomcat\",\"conf\":\"tomcat\",\"dashboard\":\"tomcat\",\"description\":\"Tomcat 服务器是一个免费的开放源代码的Web 应用服务器，属于轻量级应用服务器，在中小型系统和并发访问用户不是很多的场合下被普遍使用，是开发和调试JSP 程序的首选。使用 JMX 插件来获取内部的指标，支持多个端口号的配置。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/tomcat\",\"icon\":\"iconfont fa-tomcat\"},\"vcenter\":{\"alias\":\"VSphere\",\"conf\":\"\",\"dashboard\":\"\",\"description\":\"VSphere从 vSphere 群集CPU、磁盘、内存和网络使用情况中收集资源使用情况指标，以及监视 vCenter 服务器来查找事件并将其发送到Datadog。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/vsphere\",\"icon\":\"iconfont fa-default\"},\"weblogic\":{\"alias\":\"WebLogic\",\"conf\":\"weblogic\",\"dashboard\":\"weblogic\",\"description\":\"WebLogic是美国Oracle公司出品的一个application server，确切的说是一个基于JAVAEE架构的中间件，WebLogic是用于开发、集成、部署和管理大型分布式Web应用、网络应用和数据库应用的Java应用服务器。\",\"doc_url\":\"\",\"icon\":\"iconfont fa-weblogic\"},\"yarn\":{\"alias\":\"Yarn\",\"conf\":\"yarn\",\"dashboard\":\"yarn_mapreduce\",\"description\":\"Apache Hadoop YARN （Yet Another Resource Negotiator，另一种资源协调者）是一种新的 Hadoop 资源管理器，它是一个通用资源管理系统，可为上层应用提供统一的资源管理和调度。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/yarn\",\"icon\":\"iconfont fa-yarn\"},\"zookeeper\":{\"alias\":\"Zookeeper\",\"conf\":\"zookeeper\",\"dashboard\":\"zookeeper\",\"description\":\"ZooKeeper是一个分布式的，开放源码的分布式应用程序协调服务，是Google的Chubby一个开源的实现，是Hadoop和Hbase的重要组件。\",\"doc_url\":\"https://www.yuque.com/cloudwiz/integrations/zookeeper\",\"icon\":\"iconfont fa-zookeeper\"}}', '2019-05-06 16:20:51', '2019-08-14 16:19:09');
